import React from "react";

const RegularHours = ({ hours }) => {
  return (
    <div>
      <h3>Regular Customer Service Hours</h3>
      <table>
        <thead>
          <tr>
            <th>Day</th>
            <th>Open Time</th>
            <th>Close Time</th>
          </tr>
        </thead>
        <tbody>
          {hours.map((hour) => (
            <tr key={hour.id}>
              <td>{hour.dayOfWeek}</td>
              <td>{hour.openTime}</td>
              <td>{hour.closeTime}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default RegularHours;
